# Definition for a binary tree node.
import heapq
import unittest

# Read about enumerate in python
from collections import defaultdict, deque
from typing import List

class MinReverseOps(unittest.TestCase):

    def minReverseOperations(self, n: int, p: int, banned: List[int], k: int) -> List[int]:
        minOp = dict()
        bfsQueue = deque()
        bannedSet = set(banned)
        bfsQueue.append(p)
        remaining = set([i for i in range(n)])
        remaining.remove(p)
        remaining = remaining.difference(bannedSet)
        depth = 0
        levelSize = len(bfsQueue)
        while bfsQueue:
            for i in range(levelSize):
                head = bfsQueue.popleft()
                minOp[head] = depth

                minStart = max(0, head - (k - 1))
                maxStart = min(head, n - k)
                mirrorSet = set([start + start + k - 1 - head for start in range(minStart, maxStart + 1)])
                toBeEnqueued = mirrorSet.intersection(remaining)
                for elem in toBeEnqueued:
                    bfsQueue.append(elem)
                remaining = remaining.difference(toBeEnqueued)

            levelSize = len(bfsQueue)
            depth += 1

        result = []
        for i in range(n):
            if i not in minOp:
                result.append(-1)
            else:
                result.append(minOp[i])

        return result

    def test_example1(self):
        n = 4
        p = 0
        banned = [1, 2]
        k = 4

        # [0,-1,-1,1]
        result = self.minReverseOperations(n, p, banned, k)
        print(result)

    def test_example2(self):
        n = 5
        p = 0
